window.bookSummaryJSON = "<p><b>After years of searching, Nathan Briggs is finally on the verge of making an incredible discovery. Unfortunately, the aliens have other plans.</b></p> <p>When Nathan stops a brutal attack on an unsuspecting victim, he gets more than he bargained for and sets into motion events that will change his life forever. They told him he should’ve run away, and maybe they were right.</p> <p>Nathan is about to embark on an adventure of a lifetime.</p> <p>Aliens are real. He has something they need, and they’re not the only ones hunting for it.</p> <p>Embark on the adventure of a lifetime with bestselling author Ken Lozito in this brand-new science fiction series. If you’re a fan of old-school heroes and villains in a galaxy full of unknowns, then this is the adventure for you.</p>"; 
